$longString = '' # Your massive string goes here
$lineLength = 160
$outputArray = @()

for ($i = 0; $i -lt $longString.Length; $i += $lineLength) {
    # Calculate the length of the next segment, ensuring it doesn't exceed the remaining string length
    $length = [System.Math]::Min($lineLength, $longString.Length - $i)
    $outputArray += $longString.Substring($i, $length)
}

# Join the array elements with a newline character (`n or `r`n) for multi-line output
$result = $outputArray -join "`r`n"
Write-Output $result
